import { createApp } from 'vue'
import App from './App.vue'
import router from './routers.js'
import store from './store.js'
import axios from 'axios';
import VueAxios from 'vue-axios';

// Konfigurer axios om nødvendig (f.eks., base URL, credentials, etc.)
axios.defaults.baseURL = 'http://127.0.0.1:5000/'; // Endre dette til din API's base URL
axios.defaults.withCredentials = true; // For å tillate sending av cookies over CORS


createApp(App).use(router).use(store).use(VueAxios,axios).mount('#app');
